import * as React from 'react';
import { Button, View, Text, TextInput, StatusBar} from 'react-native';
import '@firebase/auth';
import '@firebase/firestore';

export default class SchedulingSetTimerScreen extends React.Component {
	render(){
        const [Text_Minutes, setText_Minutes] = React.useState('');
		return(
            <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
                <StatusBar barStyle="dark-content" backgroundColor="#ecf0f1" />
                <Text>Set Timer</Text>
            
                <Text> Minutes:</Text>
                <TextInput
                    value={Text_Minutes}
                    onChangeText={setText_Minutes}
                    keyboardType = {'numeric'}
                />
                
            
                <Button
                    title="Start Now"
                    onPress={() => this.props.navigation.push("Countdown Timer", Text_Minutes)}
                />
            </View>
		)
	}
}
